import React from "react"
import axios from "axios"
import Form from "./Form"

export default class NorthAmerica extends React.Component {
    state = {
        city: []
    };
    componentDidMount() {
        axios.get(`http://localhost:2500/importantCities`)
          .then(res => {
            const city = res.data;
            this.setState({ city });
          })
      }

      render() {

        return (
          <div className="cities-container">
            { this.state.city.filter(city=> city.continent[0] === "North America").map(city=> <div key={city.id} className="cities"></div>)}


          </div>
        )
      }
    }
